export default class ColorScheme {
  constructor({
    colors,
    description = '',
    id,
    label,
    isDefault
  }) {
    this.colors = void 0;
    this.description = void 0;
    this.id = void 0;
    this.label = void 0;
    this.isDefault = void 0;
    this.id = id;
    this.label = label ?? id;
    this.colors = colors;
    this.description = description;
    this.isDefault = isDefault;
  }

}